            let filterWL = data.filter(function(v){
                return v[key]
            })
            // setData(filterWL);
            function renderData(){
                if(filterWL.length > 0){
                    return filterWL.map((value,key)=>{
                        let images = filterWL[key]["image"];
                        let img = JSON.parse(images);
                        return(
                            <div class="col-sm-4">
                                <div class="product-image-wrapper">
                                    <div class="single-products">
                                        <div class="productinfo text-center">
                                                        <img src={"http://localhost:8080/laravel8/laravel8/public/upload/product/" + filterWL[key]["id_user"] + "/" + img[0] } alt="" />
                                                        <h2>{filterWL[key]["price"]}</h2>
                                                        <p>{filterWL[key]["name"]}</p>
                                                        <a href="" class="btn btn-default add-to-cart"><i class="fa fa-shopping-cart"></i>Add to cart</a>
                                        </div>
                                        <div class="product-overlay">
                                            <div class="overlay-content">
                                                <h2>{filterWL[key]["price"]}</h2>
                                                <p>{filterWL[key]["name"]}</p>
                                                <a href="" class="btn btn-default add-to-cart"><i class="fa fa-shopping-cart"></i>Add to cart</a>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="choose">
                                        <ul class="nav nav-pills nav-justified">
                                            <li><a onClick={XoaWL} id={filterWL[key]["id"]} ><i class="fa fa-plus-square"></i>Delete to wishlist</a></li>
                                            <li><a href="#"><i class="fa fa-plus-square"></i>Add to compare</a></li>
                                            <li><Link to={"http://localhost:3000/products/detail/" + filterWL[key]["id"] }>More</Link></li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                            
                        )
                    })
                }
            }
        })
        
    }

